// Function to get atlas for a given location
Rcpp::List getAtlas(std::unordered_map<std::string, Atlas>& atlasTable, const std::string& commonName) {

  // Check if the location exists in the hash table
  auto it = atlasTable.find(commonName);
  if (it != atlasTable.end()) {
    Atlas queryInfo = it->second;

    // Create a list with atlas information
    Rcpp::DataFrame result =
      Rcpp::DataFrame::create(Rcpp::Named("region") = queryInfo.region,
                              Rcpp::Named("code_country") = queryInfo.code_country,
                              Rcpp::Named("name_country") = queryInfo.name_country,
                              Rcpp::Named("lat_country") =  queryInfo.lat_country,
                              Rcpp::Named("long_country") = queryInfo.long_country,
                              Rcpp::Named("code_subdiv1") = queryInfo.code_subdiv1,
                              Rcpp::Named("name_subdiv1") = queryInfo.name_subdiv1,
                              Rcpp::Named("lat_subdiv1") =  queryInfo.lat_subdiv1,
                              Rcpp::Named("long_subdiv1") = queryInfo.long_subdiv1,
                              Rcpp::Named("code_subdiv2") = queryInfo.code_subdiv2,
                              Rcpp::Named("name_subdiv2") = queryInfo.name_subdiv2,
                              Rcpp::Named("lat_subdiv2") =  queryInfo.lat_subdiv2,
                              Rcpp::Named("long_subdiv2") = queryInfo.long_subdiv2);

    return result;
  } else {
    Rcpp::stop("Location not found in the hash table.");
  }
}

// [[Rcpp::export]]
Rcpp::List getLocation(const std::string& commonName) {
  // Create a hash table of bird atlas
  std::unordered_map<std::string, Atlas> atlasTable = createAtlasHashTable();

  // Get bird atlas for the specified common name
  return getAtlas(atlasTable, commonName);
}
